import React from 'react';
import s from './Profile.module.css';
const Profile= () => {
    return <div className={s.content}>
    <div>
    <img src="https://i.ytimg.com/vi/a7D7azmC198/maxresdefault.jpg"></img>
  </div>
  <div>
    <img src="https://i.stack.imgur.com/Lkn5a.png?s=328&g=1"></img>
    ava+description
     </div>
</div>
}
export default Profile;
